import React from 'react';
import styles from './LiveDemo.module.scss';

const LiveDemo = () => {
  return (
    <div className={styles.liveDemo}>
      <h1>Live Demo</h1>
      <h2>Basic</h2>
    </div>
  );
};

export default LiveDemo;
